import React from 'react'
import NavbarButom from '../components/NavbarButom';
import NavbarTop from '../components/NavbarTop';
import { Col, Container, Row } from 'react-bootstrap';


const TheBrigadeHero = () => {
   const h1Style = {
              textTransform: "uppercase",
              fontFamily: "Anton, sans-serif",
              lineHeight: 0.8,
              letterSpacing: "-0.08em",
              fontSize: "8rem",
              fontWeight:"900",
               color: 'transparent',
  WebkitTextStroke: '2px grey',
  };
  return (
         <div
      style={{
        backgroundColor: "#3500ff",
        minHeight: "100vh",
        color: "white",
        padding: "2rem",
      }}>
      <Container fluid>
               <Row>
              <Col className="text-end">  
              <h1 style={h1Style}>
               The<br />Brigade
              </h1>
              </Col>
          </Row>
        <NavbarTop />
        <NavbarButom />
      </Container>
    </div>
  )
}

export default TheBrigadeHero
